function out = sigh_bif_ver2
out{1} = @init;
out{2} = @fun_eval;
out{3} = @jacobian;
out{4} = @jacobianp;
out{5} = @hessians;
out{6} = @hessiansp;
out{7} = @der3;
out{8} = [];
out{9} = [];

% --------------------------------------------------------------------------
function dydt = fun_eval(t,kmrgd,par_w,par_lambdaa,par_amin,par_thetaa,par_ka,par_lambdac,par_thetac,par_kc,par_taua,par_thetas,par_ks,par_taus,par_thetatheta,par_ktheta,par_tauthetamax,par_tauthetamin,par_thetatautheta,par_ktautheta,par_eta,par_v1,par_v2,par_v3,par_k3,par_n3,par_lambda,par_thetam,par_km,par_thetah,par_kh,par_jin0,par_jin1,par_v4,par_k4,par_n4)
x=par_w*kmrgd(2)*kmrgd(1)-kmrgd(3);
ainf=par_amin+((par_lambdaa-par_amin)/(1+exp(4*(par_thetaa-x)/par_ka)))+(par_lambdac/(1+exp(4*(par_thetac-kmrgd(4))/par_kc)));
sinf=1/(1+exp(4*(par_thetas-kmrgd(1))/par_ks));
thetainf=par_lambdaa/(1+exp(4*(par_thetatheta-kmrgd(1))/par_ktheta));
tautheta=(par_tauthetamax-par_tauthetamin)/(1+exp(4*(par_thetatautheta-kmrgd(1))/par_ktautheta))+par_tauthetamin;
cer=(kmrgd(5)-kmrgd(4))/par_lambda;
finf=1/(1+exp((par_thetam-kmrgd(4))/par_km))*1/(1+exp((par_thetah-kmrgd(4))/par_kh));
dydt=[(ainf-kmrgd(1))/par_taua;
(sinf-kmrgd(2))/par_taus;
(thetainf-kmrgd(3))/tautheta;
(par_eta*par_v2+par_eta*par_v1*finf)*(cer-kmrgd(4))-((par_eta*par_v3*kmrgd(4)^par_n3)/(par_k3^par_n3+kmrgd(4)^par_n3))+par_jin0+par_jin1*kmrgd(1)-((par_v4*kmrgd(4)^par_n4)/(par_k4^par_n4+kmrgd(4)^par_n4));
par_jin0+par_jin1*kmrgd(1)-((par_v4*kmrgd(4)^par_n4)/(par_k4^par_n4+kmrgd(4)^par_n4));];

% --------------------------------------------------------------------------
function [tspan,y0,options] = init
handles = feval(sigh_bif_ver2);
y0=[0,0,0,0,0];
options = odeset('Jacobian',handles(3),'JacobianP',handles(4),'Hessians',handles(5),'HessiansP',handles(6));
tspan = [0 10];

