 par_thetah)/par_kh) + 1)*(exp(-(kmrgd(4) - par_thetam)/par_km) + 1)^2))*(kmrgd(4) + (kmrgd(4) - kmrgd(5))/par_lambda) - (kmrgd(4)^(par_n4 - 1)*par_n4*par_v4)/(kmrgd(4)^par_n4 + par_k4^par_n4) - (1/par_lambda + 1)*(par_v2*par_eta + (par_v1*par_eta)/((exp(-(kmrgd(4) - par_thetah)/par_kh) + 1)*(exp(-(kmrgd(4) - par_thetam)/par_km) + 1))) - (kmrgd(4)^(par_n3 - 1)*par_n3*par_v3*par_eta)/(kmrgd(4)^par_n3 + par_k3^par_n3) + (kmrgd(4)^par_n3*kmrgd(4)^(par_n3 - 1)*par_n3*par_v3*par_eta)/(kmrgd(4)^par_n3 + par_k3^par_n3)^2 , (par_v2*par_eta + (par_v1*par_eta)/((exp(-(kmrgd(4) - par_thetah)/par_kh) + 1)*(exp(-(kmrgd(4) - par_thetam)/par_km) + 1)))/par_lambda ; par_jin1 , 0 , 0 , (kmrgd(4)^par_n4*kmrgd(4)^(par_n4 - 1)*par_n4*par_v4)/(kmrgd(4)^par_n4 + par_k4^par_n4)^2 - (kmrgd(4)^(par_n4 - 1)*par_n4*par_v4)/(kmrgd(4)^par_n4 + par_k4^par_n4) , 0 ];
